import React from 'react';
import './App.css';
import Login from '../src/componentes/Login/Login'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Administrador from './'


function App() {
  <Router>
    <div>
      <Link to="/">
        Login
      </Link>
      <Link to="/Administrador">
        Administrador
      </Link>
    </div>
    <Switch>
      <Route path="/" exact>
        <Login />
      </Route>
      <Route path="/Administrador" exact>
        <Administrador />
      </Route>
    </Switch>
  </Router>
  return (
    <div className="App">
      <Login/>
    </div>
  );
}

export default App;
